function replaceSince(e){var i=e.firstChild.data,s,o,t,n;if(e.title=i,s=new Date(Date.now()),o=new Date(i),t=s.getTime()-o.getTime(),t<60*60*1e3){e.firstChild.data=Math.floor(t/(60*1e3))+" minutes ago";return}if(t<24*60*60*1e3){e.firstChild.data=Math.floor(t/(60*60*1e3))+" hours ago";return}if(t<28*24*60*60*1e3){e.firstChild.data=Math.floor(t/(24*60*60*1e3))+" days ago";return}if(n=s.getFullYear()*12+s.getMonth()+1-(o.getFullYear()*12+o.getMonth()+1),n<12){e.firstChild.data=n+" months ago";return}if(n>0){e.firstChild.data=Math.trunc(n/12)+" years ago";return}e.firstChild.data="now"}